//SPDX-License-Identifier: BUSL-1.1
pragma solidity ^0.8.0;

import "./2_VaultP.sol";

contract VaultFactP {

    address[] public VaultList;
    address public segaFactory;
    address public RCU;
    address public admin;

    event VaultCreated(address indexed owner, address indexed vault);

    constructor(address _segaFactory){
        segaFactory = _segaFactory;
        admin = msg.sender;
    }

    function setRCU (address _rcu) public {
        require(msg.sender == admin,"Not Admin");
        RCU = _rcu;
    }

    function createVault(address _owner) external returns (address) {
        Vault vault = new Vault(RCU, _owner , segaFactory);
        VaultList.push(address(vault));
        emit VaultCreated(_owner, address(vault));
        return address(vault);
    } 

    function getVaultList() public view returns (address[] memory) {
        return VaultList;
    }
}
